import React from 'react';
import { 
  Paper,
  Typography 
} from '@material-ui/core';

const styles = {
  wrapper: {
    position: 'absolute', 
    left: '50%', 
    top: '50%',
    transform: 'translate(-50%, -50%)'
  } as React.CSSProperties,

  container: {
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    flexDirection: 'column',
    width: '80vw',
    height: '80vh'
  } as React.CSSProperties,
}

const HomeScreen = () => {
  return (
    <div style={styles.wrapper}>
      <Paper style={styles.container}>
        <Typography 
            variant='h2' 
            component='div'>
              Minha carteira
        </Typography>
      </Paper>
    </div>
  );
}

export default HomeScreen;
